post_text:
We are thrilled to share the Oklahoma State Department of Education has granted a waiver to Tulsa Public Schools, which will allow parents and guardians to pick up meals without having your student present. Starting on Friday, April 3, parents and guardians can bring the following forms of ID to receive breakfast and lunch for your child at our meal-sites or bus stops. Parents can use any of the following:

‚Ä¢Student ID;
‚Ä¢School report card;
‚Ä¢Child's passport;
‚Ä¢Child's birth certificate;
‚Ä¢Government-issued child identification card;
‚Ä¢Any document providing parent/guardian identity and relationship to the child, such as an adoption decree; doctor, clinic, or hospital record; religious record; or a daycare center record; or
‚Ä¢Text message sent to all parents/guardians from the district‚Äôs short-code (67587) regarding the pick-up of meals without children

You only need to bring ONE of these forms of identification to meal-sites. If you bring identification, your child does not need to be present. You can find meal-sites and service times at www.tulsaschools.org/mealsites.

